import React from "react";
import { stockData } from "./Json.";
const CardConfig  = [
    {
      component: "card",
      children: [
        {
          component: "img",
          src:
            "https://images.pexels.com/photos/2877188/pexels-photo-2877188.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
        },
        {
          component: "body",
          children: [
            {
              component: "title",
              children: "This is a title"
            },
            {
              component: "subtitle",
              children: "This is the subtitle"
            },
            {
              component: "text",
              children:
                "Some quick example text to build on the card title and make up the bulk of the card's content."
            },
            {
              component: "button",
              children: "Click Me!"
            }
          ]
        }
      ]
    }
  ];
function Dynamic(){
    return(
        <div>
            {stockData.map((data, key) => {
                return(
                    <div>
                        {data.widgetName} <br/>
                        {data.value}<br/>
                        {data.unit}<br/>
                        {data.limit.value}<br/>
                        {data.limit.unit}<br/>
                        {data.timeSeriesData.values}
                    </div>
                )
            })}

        </div>
    )
}

export default Dynamic;
